import { Box, Button, Divider, Flex, Heading, Spacer } from "@chakra-ui/react";

export default function Header() {
  return (
    <Flex p={2}>
      <Box p="2">
        <Heading size="md">Chakra App</Heading>
      </Box>
      <Spacer />
      <Box>
        <Button colorScheme="green">Info ℹ️</Button>
      </Box>
      <Divider />
    </Flex>
  );
}
